import React, { useState, useEffect } from 'react'
import FetchCovidFinland from '../api/FetchCovidFinland';

export default function Covid() {
  const [query, setQuery] = useState<string>("")
  const [covid, setCovid] = useState<any>("")

  const search = async () => {
    const res: any = await FetchCovidFinland();
    console.log(res);
    setCovid(res);
    setQuery('')
  }
  const getData = async () => {
    try {
      const response = await fetch("https://sampo.thl.fi/pivot/prod/en/epirapo/covid19case/fact_epirapo_covid19case.json");
      const json = await response.json();
      setCovid(json);
    } catch (err) {
      console.error(err.message);
    }
  }

  useEffect(() => {
    getData();
  }, [])

  useEffect(() => {
    console.log("Covid : ", covid)
  }, [covid])

  return (
    <div className="main-container">
      <div>
        <label className="text-center" >Search
        <input id="search" name="search" type="text" className="search" placeholder="Search..." value={query} onChange={(e) => setQuery(e.target.value)} onKeyPress={search} />
        </label>
      </div>
      {
        covid && (
          <div className="city">
            <div className="city-temp">
              Today
            </div>
            <div className="info">
              <p style={{ color: "black" }}>{covid.label}</p>
            </div>
          </div>
        )
      }
    </div>
  )
}
